import React, { FunctionComponent, useEffect, useState } from "react";
import { UnitsArray } from "../Logic/GenerateUnits";
// import Unit from "../strategy/classes/unit/Unit";
import "./CenterPart.css";
import defense from "../../src/img/18-512.png";
import Unit from "../strategy/classes/unit/Unit";
import { UnitUI } from "./UnitUI";

interface CenterPartProps {
  units: Array<Unit>;
}
export const CenterPartV2: FunctionComponent<CenterPartProps> = props => {
  // const unitsArrayUI = props.units.map((unit, index) => {
  //   <UnitUI currentUnit="ADFASF" currentIndex={index} />;
  // });
  console.log(UnitsArray);
  let [a, setA] = useState(props.units[0]._HP);
  const renderCell = () => {
    const unitsArrayUI = props.units.map((unit, index) => {
      return (
        <div className="cell" key={index}>
          <div className="cell__unit-info">
            <img
              onClick={() => {
                unit.doHPreduce(1, 1);
              }}
              className="cell__unit-info__image"
              src={unit._imgPath}
              alt="img"
            />
            <div className="cell__unit-info__options">
              <div className="cell__unit-info__options__defense">
                <button
                  onClick={() => {
                    console.log(unit);
                    unit.doHPreduce(1, 1);
                    setA(unit._HP);
                    console.log(unit);
                  }}
                >
                  <img src={defense} width={40} alt="img" />
                </button>
              </div>
            </div>
          </div>
          <div className="cell__HP">
            <progress className="cell__HP__bar" value={unit._HP} max={100}>
              {unit._HP}
            </progress>
          </div>
        </div>
      );
    });
  return unitsArrayUI;
  // return <div>123</div>

};

